import { useEffect, useState } from "react";
import { getProfile, updateProfile } from "../services/api";

export default function Profile({ token }) {
  const [profile, setProfile] = useState(null);
  const [edit, setEdit] = useState(false);
  const [form, setForm] = useState({
    height: "",
    weight: "",
    diseases: "",
    photo: "",
  });

  useEffect(() => {
    loadProfile();
  }, []);

  const loadProfile = async () => {
    const data = await getProfile(token);
    setProfile(data || {});
    setForm({
      height: data?.height || "",
      weight: data?.weight || "",
      diseases: data?.diseases || "",
      photo: data?.photo || "",
    });
  };

  const save = async () => {
    await updateProfile(form, token);
    await loadProfile();
    setEdit(false);
  };

  const uploadPhoto = (e) => {
    const file = e.target.files[0];
    const reader = new FileReader();
    reader.onload = () => {
      setForm({ ...form, photo: reader.result });
    };
    reader.readAsDataURL(file);
  };

  if (!profile) return <p>–ó–∞–≥—Ä—É–∑–∫–∞...</p>;

  return (
    <div className="container">
      <h1>–ü—Ä–æ—Ñ–∏–ª—å</h1>

      <div className="card">
        {form.photo && <img src={form.photo} alt="avatar" width={120} />}

        {!edit ? (
          <>
            <p><b>–†–æ—Å—Ç:</b> {profile.height || "‚Äî"}</p>
            <p><b>–í–µ—Å:</b> {profile.weight || "‚Äî"}</p>
            <p><b>–ó–∞–±–æ–ª–µ–≤–∞–Ω–∏—è:</b> {profile.diseases || "‚Äî"}</p>

            <button onClick={() => setEdit(true)}>
              ‚úèÔ∏è –†–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞—Ç—å
            </button>
          </>
        ) : (
          <>
            <input
              placeholder="–†–æ—Å—Ç"
              value={form.height}
              onChange={(e) => setForm({ ...form, height: e.target.value })}
            />
            <input
              placeholder="–í–µ—Å"
              value={form.weight}
              onChange={(e) => setForm({ ...form, weight: e.target.value })}
            />
            <textarea
              placeholder="–•—Ä–æ–Ω–∏—á–µ—Å–∫–∏–µ –∑–∞–±–æ–ª–µ–≤–∞–Ω–∏—è"
              value={form.diseases}
              onChange={(e) => setForm({ ...form, diseases: e.target.value })}
            />

            <input type="file" accept="image/*" onChange={uploadPhoto} />

            <button onClick={save}>üíæ –°–æ—Ö—Ä–∞–Ω–∏—Ç—å</button>
            <button onClick={() => setEdit(false)}>‚ùå –û—Ç–º–µ–Ω–∞</button>
          </>
        )}

        {profile.approved === 0 && (
          <p style={{ color: "orange" }}>
            ‚è≥ –û–∂–∏–¥–∞–µ—Ç –ø–æ–¥—Ç–≤–µ—Ä–∂–¥–µ–Ω–∏—è –≤—Ä–∞—á–∞
          </p>
        )}
        {profile.approved === 1 && (
          <p style={{ color: "green" }}>
            ‚úÖ –ü–æ–¥—Ç–≤–µ—Ä–∂–¥–µ–Ω–æ –≤—Ä–∞—á–æ–º
          </p>
        )}
      </div>
    </div>
  );
}
